    if(flag === 0){
        fetch("/result/summary")
        .then(response => {
            response.blob().then(blob => {
                let url = window.URL.createObjectURL(blob);
                let a = document.createElement('a');
                a.href = url;
                a.download = "summary.pdf";

                a.click();
                a.remove();
            });

    });
}
    else {
        fetch("/result/transcript")
        .then(response => {
            response.blob().then(blob => {
                let url = window.URL.createObjectURL(blob);
                let a = document.createElement('a');
                a.href = url;
                a.download = "transcript.txt";

                a.click();
                a.remove();
            });

    });
    }
}

